import './App.css';
import Button from '../../presentational/atoms/Button';
import BordContainer from '../organisms/bordContainer';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>Hello React</div>
      </header>
      <body>
        <Button label="ボタン" />
        <BordContainer />
      </body>
    </div>
  );
}

export default App;
